import logo from "./logo.svg";
import "./App.css";

import DataTable from "react-data-table-component";

const columns = [
    {
        name: "Title",
        selector: (row) => row.title,
    },
    {
        name: "Year",
        selector: (row) => row.year,
    },
];

const data = [
    {
        id: 1,
        title: "Beetlejuice",
        year: "1988",
    },
    {
        id: 2,
        title: "Ghostbusters",
        year: "1984",
    },
];

function App() {
    return <DataTable columns={columns} data={data} />;
}

export default App;
